import React from 'react';

const GenderSelector = () => {
  return (
    <div>
      <label>
        Gender:
        <select>
          <option value="male">Male</option>
          <option value="female">Female</option>
        </select>
      </label>
    </div>
  );
}

export default GenderSelector;
